import { Typography } from "@material-ui/core";
import React, { Fragment } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Cards } from "./CardsContainer";


export function SecondScreen(){
    return(
        <Container fluid>
            <Row className='justify-content-center'>
                <Col sm md={8}>
                    <Typography className='text-center' variant='h4'>¿Cómo lo hacemos realidad?</Typography>
                    <Typography className='text-center'>Nuestro modelo de riesgos evalúa en segundos una operación, lo que nos permite financiar en el mismo día.</Typography>
                </Col>
                <Col sm md={10}>
                    <CardsContainer/>
                </Col>
            </Row>
        </Container>
    )
}
